Diagnosis
. 
Female
. Macropterous. Mesosoma and head concolorous, dark brown with reduced metallic lustre (
Fig. 7
); gaster mostly brown except for partly white to hyaline Gt1. Legs and scape (
Fig. 7
) brown-yellow to variably darkened but at least following brown: meso- and metacoxae, profemur on posterior surface and metafemur on anterior surface, scape basally and apically on dorsal and outer surfaces. Head not conspicuously modified, convex, with lower parascrobal region passing smoothly into gena (
Figs 11, 12
). Clypeus protuberant, convex, apically serrate (
Figs 11, 12
). Scrobal depression deep, with sloping, non-carinate sides, smooth and shiny including scrobes and coriaceous along outer margins (
Figs 11, 12
). Frontovertex between ocellar triangle and scrobal depression coriaceous (
Figs 11, 12
). Mesoscutum mostly coriaceous except imbricate-coriaceous to reticulate on median lobe (
Fig. 14
). Mesoscutellum and axillae differentiated and distinct, scutellum slightly convex. Acropleuron reticulate. Fore wing in larger specimens frequently with a distinct dark cloud behind marginal and stigmal veins (
Fig. 16
).

Male
. Body brown with reduced violet lustre under some angles of illumination (
Fig. 8
). Head in exact dorsal view (
Fig. 77
) 4.5–4.7× breadth of an eye measured along a transverse axis as in figure 73. Frontovertex between ocellar triangle and scrobal depression coriaceous (
Fig. 76
). Scrobal depression including scrobes smooth and shiny except for superficially sculptured outer margins (
Fig. 76
). Funicle with first segment plus strongly reduced anellus 2.7–3.8× as long as wide (
Fig. 66
). Mesoscutum coriaceous except midlobe imbricate in anterior one-third to half, with at most some cells slightly depressed mesally; lateral lobe coriaceous to imbricate-coriaceous (
Fig. 19
). Mesoscutellum coriaceous. Metascutellum transverse-ovoidal, with lateroventral corners abruptly sunken (
Fig. 68
). Fore wing stigma an elongated rectangle; uncus frequently almost to fully as long as height of stigma (
Fig. 60
).
